import React from 'react'
import '../css'

const Index = () => {
  return (
    <div className='bg-gray-700 px-52 pt-20'>
      <div className='box-border border-2 h-8 w-52 border-black bg-green-500 border-green-500'>
        <p className='text-center font-Oxygen'>Desenvolvedor FullStack</p>
      </div>
    </div>
  )
}
export default Index
